import classes from './Card.module.css';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Card = ({ card }) => {
    return (
        <div className = {classes.card}>
  <div><h2>{card.card_title}</h2></div>
  {card.data && <div><p>{card.data_type}: {card.data_value}</p></div>}
  {card.button && <div><button className='btn btn-primary'>{card.button_name}</button></div>}
  {card.link && <div><a href={card.redirect}>{card.link_name}</a></div>}
  {card.note && <div><p>{card.note}</p></div>}
</div>
    );
  };

  export default Card;
